export const COLUMNS = [
  {
    Header: "Common Name",
    accessor: 'comName',
    Cell: 
     {props: function onClickPic(){const ebird_redirect = `https://ebird.org/species/${code}`;
      window.open(ebird_redirect);
      console.log('click')}
      }
    
  },
  {
      Header: "Scientific Name",
      accessor: 'sciName'
  },
  {
